import React, { useState } from "react";
import { FaStream } from "react-icons/fa";
import { VscClose } from "react-icons/vsc";

const Header = () => {
    const [close, setClose] = useState(false);

    const MobileViewBtn = () => {
        setClose(!close);
    };

    return (
        <div className="w-40/50 bg-white ml-auto mr-auto mt-3 rounded">
            <header className="flex justify-between cursor-pointer">
                <div className="">
                    <img
                        src="/logo.png"
                        alt="logo"
                        className="w-10 h-10 rounded-full "
                    />
                </div>
                <div className="flex">
                    <ul className="sm:hidden md:flex justify-between ml-4 mt-4">
                        <li className="mr-6 hover:text-emerald-600">About</li>
                        <li className="mr-6 hover:text-emerald-600">
                            Portfolio
                        </li>
                        <li className="mr-6 hover:text-emerald-600">Work</li>
                        <li className="mr-6 hover:text-emerald-600">Contact</li>
                    </ul>
                </div>

                <div className="flex rounded-2xl  border-emerald-200 border-2 p-3 ">
                    <div className="mr-6 font-bold w-10  rounded-full text-center text-emerald-600 hover:bg-emerald-500">
                        Profile
                    </div>
                    <div className="font-bold text-emerald-600">Blog</div>
                </div>
            </header>
        </div>
    );
};

export default Header;
